import React from "react";
import Play from "./components/play";
import Users from "./components/users";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      selectPage: true,
    };
  }
  render() {
    return (
      <div>
        {this.props.text};
        {this.state.selectPage ? (
          <Users sel={this.state.selectPage} />
        ) : (
          <Play />
        )}
      </div>
    );
  }
}

export default App;
